import React, { Component } from 'react';
import logo from './logo.svg';
import paypalLogo from './paypal-logo-color.svg';
import './App.css';
import NavigationBar from './components/Navigation';

class App extends Component {
  render() {
    return (
      <div className="App">
      <NavigationBar/>
      </div>
    );
  }
}

export default App;
